import React from 'react'
import {GroupItemNavLink} from '../style'
import {Text} from '../../../../UIComponents/Typography/Text'
import {ImageLazyLoad} from '../../../../UIComponents/ImageLazyLoad'

export const OfferingGroupItem = ({imgUrl, path, isActive, name}) => {

    return (
        <GroupItemNavLink
            to={path}
            isActive={() => isActive()}
        >
            {/*<Avatar size={60} shape='square' imgUrl={imgUrl}/>*/}
            <ImageLazyLoad src={imgUrl}/>
            <Text level={5}>
                {name}
            </Text>
        </GroupItemNavLink>
    )
}
